import React from 'react'
import { Routes, Route, Link } from 'react-router-dom';
import Home from './Home'
import Home2 from './Home2';
import Category from './Category';
import DetailProduct from './DetailProduct';
import ListingGrid from './ListingGrid';
import ListingLarg from './ListingLarge';
import Offer from './Offer';
import Payment from './Payment';
import UserLogin from './UserLogin';
import UserRegister from './UserRegister';
import ShoppingCart from './ShoppingCart';
import Content from './Content';
import ProfileMain from './ProfileMain';
import ProfileAddress from './ProfileAddress';
import ProfileOrder from './ProfileOrder';
import ProfileSeller from './ProfileSeller';
import ProfileWishList from './ProfileWishList';
import ProfileSetting from './ProfileSetting';
const Main = () => (
    <main>
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/allcategory" element={<Category />} />
            <Route path="/listinglarge" element={<ListingLarg />} />
            <Route path="/listinggrid" element={<ListingGrid />} />
            <Route path="/shoppingcart" element={<ShoppingCart />} />
            <Route path="/productdetail" element={<DetailProduct />} />
            <Route path="/content" element={<Content />} />
            <Route path="/login" element={<UserLogin />} />
            <Route path="/register" element={<UserRegister />} />
            <Route path="/profilemain" element={<ProfileMain />} />
            <Route path="/profileaddress" element={<ProfileAddress />} />
            <Route path="/order" element={<ProfileOrder />} />
            <Route path="/seller" element={<ProfileSeller />} />
            <Route path="/wishlist" element={<ProfileWishList />} />
            <Route path="/setting" element={<ProfileSetting />} />
            <Route path="/home2" element={<Home2 />} />
        </Routes>
    </main>
)
export default Main
